‼️ 2022 RECAP ‼️
Made so many awesome memories this past year like graduating high school, traveling further, qualifying and competing at Worlds, and building and maintaining relationships with all sorts of great people. I’m super excited to see where life takes me in 2023. I appreciate everyone that has helped me out and supported me on and off of the scooter! Much love. ❤️ Hope you guys had a safe and fun New Years with your friends and family and are also looking forward to accomplishing your goals in ‘23. 🤝🏻🤙🏻
